import React from 'react';
import plantImg from '../assets/plant.png';

const HomeView = () => {
    return (
        <div className="flex flex-col justify-between items-center h-screen bg-green-50 relative overflow-hidden">
            {/* Header */}
            <div className="w-full text-left px-4 py-2 text-xs text-gray-500">
                <span>07:45</span>
                <span className="float-right">84%</span>
            </div>

            {/* Main Content */}
            <div className="flex flex-col items-center justify-center text-center px-6">
                {/* Plant image */}
                <img
                    src="../assets/plant.png" // reemplaza con tu ruta o usa una imagen pública
                    alt="Fresh Plant"
                    className="w-40 h-40 mb-4"
                />

                {/* Title */}
                <h1 className="text-2xl font-bold text-green-600 mb-2">Fresh Plant</h1>

                {/* Description */}
                <p className="text-gray-500 text-sm mb-6">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean commodo ligula eget dolor.
                </p>

                {/* Button */}
                <a
                    href="/upload"
                    className="bg-green-500 text-white text-sm px-6 py-2 rounded-full shadow-md hover:bg-green-600 transition"
                >
                    Informations
                </a>
            </div>

            {/* Decorative Waves at Bottom */}
            <div className="absolute bottom-0 w-full">
                <svg
                    viewBox="0 0 1440 320"
                    className="w-full h-32"
                    preserveAspectRatio="none"
                >
                    <path
                        fill="#22c55e"
                        fillOpacity="1"
                        d="M0,64L48,80C96,96,192,128,288,144C384,160,480,160,576,154.7C672,149,768,139,864,138.7C960,139,1056,149,1152,154.7C1248,160,1344,160,1392,160L1440,160L1440,320L1392,320C1344,320,1248,320,1152,320C1056,320,960,320,864,320C768,320,672,320,576,320C480,320,384,320,288,320C192,320,96,320,48,320L0,320Z"
                    ></path>
                </svg>
            </div>
        </div>
    );
};

export default HomeView;
